import React from 'react';
import { isPropertySignature, readBuilderProgram } from 'typescript';
import { styled } from '@mui/system';
import { Button } from '@mui/material'
import drone from '../../assets/images/drone.jpg'

interface Props {
    title: string;
}

const Root = styled('div')({
    padding: 0,
    margin: 0
})

const NavbarContainer = styled('div') ({
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center'
})

const Logo = styled('h1')({
    margin: '0 0 0 0.45'
})

const LogoA = styled('a')({
    color: 'rgb(28,24,22)',
    listStyle: 'none',
    textTransform: 'uppercase',
    textDecoration: 'none'
})

const LogoNavigation = styled('ul')({
    listStyle: 'none',
    textTransform: 'uppercase',
    textDecoration: 'none',
    display: "flex"
})

const NavA = styled ('a')({
    display: 'block',
    padding: '1em',
    color: 'black'
})

export const Home = (props:Props) => {
    return (
        <Root>
            <NavbarContainer>
                <Logo>
                    <LogoA href='#'>Ranger Drones</LogoA>
                </Logo>
                <LogoNavigation>
                    <li>
                        <NavA href='#'>Home</NavA>
                    </li>
                    <li>
                        <NavA href='#'>About</NavA>
                    </li>
                    <li>
                        <NavA href='#'>Learn More</NavA>
                    </li>
                </LogoNavigation>
            </NavbarContainer>
            <Main>
                <MainText>
                    <h1>(props.title)</h1>
                    <p>All your Drones are here.</p>
                    <Button color='primary' variant='contained'>See the Drones</Button>
                </MainText>
            </Main>
        </Root>

    )
}
